import { GET_CITIES } from "../actions/getCities";

const initialState = {

    items: [
        { name: "eggs" },
        { game: "asf" }
    ]
}



export default function (state = initialState, action) {
    switch (action.type) {
        case GET_CITIES:
            return {
                ...state

            }
        default: state
    }

}

